def epwtojson():
	epws = os.listdir(dstDir)
	for epw in epws:
		if epw.endswith(".epw"):
			epwf = dstDir + "/"+epw
			w = cc.wthImp(epwf)
			wi = w.dataWth()
			ww = cc.wrangleWth(wi)
			wthdata = json.dumps(ww.WTH())
			jsnfile_ = epw.replace(".epw",".json")
			jsnfile = dstDirJ + "/" + jsnfile_
			with open(jsnfile,'w') as f:
			    f.write(wthdata)

